import React, { Component } from 'react';
import './App.css';
import SideBar from './componentes/SideBar';
import simple from './averysimplecomponent'
import {BrowserRouter as Router, Route, Link} from 'react-router-dom'
import LogIn from './componentes/LogIn';

function intento () {
  return (
    <p>
      holiwis
    </p>
  )
}

function SideBar1() {
  return <SideBar/>;
}

function LogIn1() {
  return <LogIn/>;
}


function AppRouter() {
  return (
    <Router>
      <div>

        <Route path="/" exact component={SideBar1} />
        <Route path="/LogIn/" component={LogIn1} />
      </div>
    </Router>
  );
}


class App extends Component {
  render() {
    return (
      <AppRouter/>
    );
  }
}

export default App;
